// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/governance/TimelockController.sol";


contract TimelockFactory{

    event NewTimelockControllerCreated(address admin, address indexed timelockControllerAddress);

    uint numOfProjects;

    struct projectMeta{
        uint256 id;
        uint256 votingPeriod;
        address contractAddress;
    }

    // projectMeta[] public deployedProjects;
    mapping(uint => projectMeta) private deployedProjects;

    function createTimeLock(
        uint256 votingPeriod,
        address[] memory proposers,
        address[] memory executors,
        address admin
    ) external returns (address) {
        uint timelockId = numOfProjects++;
        projectMeta storage currentTimelock = deployedProjects[timelockId];
        currentTimelock.id = timelockId;
        currentTimelock.votingPeriod = votingPeriod;
        TimelockController timelock = new TimelockController(
            votingPeriod,
            proposers,
            executors,
            admin
        );
        currentTimelock.contractAddress = address(timelock);

        // timelock.setPendingAdmin(msg.sender);

        emit NewTimelockControllerCreated(admin, address(timelock));
        return address(timelock);
    }

    function getAllDeployedTimelocks () public view returns (projectMeta[] memory props){
        props = new projectMeta[](numOfProjects);
        for(uint256 index=0; index<numOfProjects; index++){
            props[index]= deployedProjects[index];
        }
    }
}
